using System;
using System.Linq;
using _2018.Utils;

namespace _2018.Days
{
    public class Day5 : Day
    {
        private readonly string _input;

        public Day5()
        {
            this._input =
                "";
        }
        
        protected override void DoPart1()
        {
            var newPolymer = React(this._input);
            
            ConsoleUtils.WriteColouredLine($"{newPolymer.Length} units remain", ConsoleColor.Cyan);
        }

        private static string React(string polymer)
        {
            string oldPolymer;
            var newPolymer = polymer;

            do
            {
                oldPolymer = newPolymer;
                newPolymer = RemoveReactants(oldPolymer);
            } while (oldPolymer.Length != newPolymer.Length);

            return newPolymer;
        }

        private static string RemoveReactants(string polymer)
        {
            var newPolymer = "";
            char? prevChar = null;

            foreach (var unit in polymer)
            {
                if (!prevChar.HasValue)
                {
                    prevChar = unit;
                }
                else
                {
                    if (char.ToLower(unit) == char.ToLower(prevChar.Value) && unit != prevChar.Value)
                    {
                        // Same letter, different casing - react.
                        prevChar = null;
                    }
                    else
                    {
                        newPolymer += prevChar;
                        prevChar = unit;
                    }
                }
            }

            if (prevChar.HasValue)
            {
                newPolymer += prevChar;
            }

            return newPolymer;
        }

        protected override void DoPart2()
        {
            var minReactantLength = int.MaxValue;
            
            for (var unit = 'a'; unit <= 'z'; unit++)
            {
                var polymer = "";

                foreach (var t in this._input)
                {
                    if (char.ToLower(t) != unit)
                    {
                        polymer += t;
                    }
                }

                var newPolymer = React(polymer);

                if (newPolymer.Length < minReactantLength)
                {
                    minReactantLength = newPolymer.Length;
                }
                
                ConsoleUtils.WriteColouredLine($"Tried removing {unit}, got length {newPolymer.Length}", ConsoleColor.DarkYellow);
            }
            
            ConsoleUtils.WriteColouredLine($"Shortest produced polymer has {minReactantLength} units", ConsoleColor.Cyan);
        }
    }
}